        <Layout>
            <Head>
                <title>Home</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>
            <main>
                <section className="home-banner">
                    <div className="banner-content">
                        <h1>Get the best candidate for nex vacantcy</h1>
                    </div>
                </section>
            </main>
        </Layout>
    )
}
export default Home;
